import React, { Component } from "react";
import EgyesuletekService from "../service/EgyesuletekService";
import KeresService from "../service/KeresService";

class Jovahagyas extends Component {
  constructor(props) {
    super(props);

    this.state = {
      id: this.props.match.params.id,
      egyesuletek: [],
      keresek: [],
    };
  }
  componentWillMount() {
    KeresService.getKeresById(this.state.id)
      .then((res) => {
        this.setState({ keresek: res.data });
        console.log(this.state.keresek);
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });
    EgyesuletekService.getEgyesuletek()
      .then((res) => {
        this.setState({ egyesuletek: res.data });
        console.log(this.state.egyesuletek);
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });
}
  render() {
    if (!this.state.keresek.length) return null;
    return (
      <div>
        <div class="jovahagyas">
          <input
            type="text"
            // value={this.state.keresek.tulajdonos.nev}
            // placeholder={this.state.keresek.tulajdonos.nev}
          />
          <input type="text" />
          <button class="infoBtnAdd">jovahagy</button>
        </div>
        <table className="keresekTable">
          <thead>
            <tr>
              <th>Jobbful</th>
              <th>Balful</th>
              <th>Anyajobbful</th>
              <th>Anyabalful</th>
              <th>Apajobbful</th>
              <th>Apabalful</th>
              <th>bakok</th>
              <th>nostenyek</th>
              <th>fajta</th>
              <th>szuldat</th>
              <th>tenyeszto</th>
            </tr>
          </thead>
          <tbody>
            {this.state.egyesuletek.map((egyesulet) => (
              <tr>
                <td>{egyesulet.azonosito}</td>
                <td>{this.props.match.params.id}</td>
                <td>{this.state.keresek.tulajdonos.nev}</td>
                <td></td>
                <td></td>
                <td></td>
                <td></td>
                <td></td>
                <td></td>
                <td></td>
                <td></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Jovahagyas;
